-- 0. Use database ------------------------------ 
USE group07_database;
-- 1. Drop all Tables ------------------------------ 
DROP TABLE if exists cargo;
DROP TABLE if exists assign; 
DROP TABLE if exists dock;
DROP TABLE if exists employee; 
DROP TABLE if exists crew; 
DROP TABLE if exists ship;
-- 2. Create all Tables ------------------------------ 
create table ship (
	imoNo INT,
	classification VARCHAR(13),
	shipName VARCHAR(50),
	countryRegistration VARCHAR(50),
	countryRegistrationCode VARCHAR(50),
	city VARCHAR(50),
	yearOfConstruction VARCHAR(50),
	tonnage INT,
    PRIMARY KEY(imoNo)
);
create table crew (
	crewID INT,
	crewDay VARCHAR(14),
	crewTime VARCHAR(9),
    PRIMARY KEY(crewID)
);
create table employee (
	employeeID INT,
	firstName VARCHAR(50),
	lastName VARCHAR(50),
	jobPosition VARCHAR(10),
	salary INT,
    PRIMARY KEY(employeeID)
);
create table dock (
	dockID INT,
	dockName VARCHAR(50),
	location VARCHAR(11),
	crewID INT,
    PRIMARY KEY(dockID),
    FOREIGN KEY(crewID) REFERENCES crew(crewID)
);
create table assign (
	employeeID INT,
	crewID INT,
    PRIMARY KEY(employeeID, crewID),
    FOREIGN KEY(employeeID) REFERENCES employee(employeeID),
    FOREIGN KEY(crewID) REFERENCES crew(crewID)
);
create table cargo (
	cargoID INT,
	cargoDate DATE,
	cargoWeight INT,
	cargoGoodsClass INT,
	cargoDangerousGoods VARCHAR(3),
	cargoDangerousGoodsClassification VARCHAR(25),
	imoNo INT,
	dockID INT,
	crewID INT,
    PRIMARY KEY(cargoID),
    FOREIGN KEY(imoNo) REFERENCES ship(imoNo),
    FOREIGN KEY(dockID) REFERENCES dock(dockID),
    FOREIGN KEY(crewID) REFERENCES crew(crewID)
);
